'use strict';

const target = process.env.BABEL_TARGET;
const output = process.env.BABEL_OUTPUT;
const env = process.env.NODE_ENV;
const modules = output == null ? false : output;

const targets = env === 'test' ? { node: 'current' } : undefined;

const options = {
  comments: false,
  minified: true,
  assumptions: {
    ignoreToPrimitiveHint: true,
    iterableIsArray: true,
    mutableTemplateObject: true,
    noNewArrows: true,
    objectRestNoSymbols: true,
    setComputedProperties: true,
    setSpreadProperties: true,
  },
  presets: [
    [
      '@babel/env',
      {
        bugfixes: true,
        loose: true,
        modules,
        targets,
        corejs: '3',
        useBuiltIns: 'entry',
      },
    ],
    ['@babel/react', { useBuiltIns: true }],
  ],
  plugins: [],
};

if (target === 'examples') {
  options.plugins.push([
    'transform-react-remove-prop-types',
    { removeImport: true },
  ]);
} else if (env !== 'test') {
  options.plugins.push(['transform-react-remove-prop-types', { mode: 'wrap' }]);
}

module.exports = options;

import globals from 'globals';
import babelParser from '@babel/eslint-parser';
import js from '@eslint/js';
import reactPlugin from 'eslint-plugin-react';
import importPlugin from 'eslint-plugin-import';
import jsxA11yPlugin from 'eslint-plugin-jsx-a11y';
import prettierRecommended from 'eslint-plugin-prettier/recommended';

export default [
  js.configs.recommended,
  reactPlugin.configs.flat.recommended,
  importPlugin.flatConfigs.recommended,
  importPlugin.flatConfigs.react,
  jsxA11yPlugin.flatConfigs.recommended,
  prettierRecommended,
  {
    ignores: ['webpack.*', '**/lib', '**/dist', '**/esm'],
  },
  {
    languageOptions: {
      globals: {
        ...globals.browser,
        ...globals.node,
      },

      parser: babelParser,

      parserOptions: {
        requireConfigFile: false,
      },
    },

    settings: {
      react: {
        version: 'detect',
      },
    },

    rules: {
      'jsx-a11y/no-static-element-interactions': 'off',

      'import/no-extraneous-dependencies': [
        'error',
        {
          devDependencies: [
            '**/__tests__/**/*',
            'examples/src/**/*.js',
            'rollup.config.js',
            'webpack.config.js',
          ],

          optionalDependencies: false,
        },
      ],

      'no-unused-vars': [
        'error',
        {
          ignoreRestSiblings: true,
        },
      ],

      'no-console': 'error',
      'react/prop-types': 'off',
    },
  },
  {
    files: ['**/*-test.js'],

    languageOptions: {
      globals: {
        ...globals.jest,
      },
    },
  },
];

import { FunctionComponent, HTMLProps } from 'react';

export interface TabsProps
  extends Omit<HTMLProps<HTMLDivElement>, 'className' | 'onSelect' | 'ref'> {
  className?: string | string[] | { [name: string]: boolean } | undefined;
  defaultFocus?: boolean | undefined;
  defaultIndex?: number | undefined;
  direction?: 'rtl' | 'ltr' | undefined;
  disabledTabClassName?: string | undefined;
  disableUpDownKeys?: boolean | undefined;
  disableLeftRightKeys?: boolean | undefined;
  domRef?: ((node?: HTMLElement) => void) | undefined;
  environment?: Window | undefined;
  focusTabOnClick?: boolean | undefined;
  forceRenderTabPanel?: boolean | undefined;
  onSelect?:
    | ((index: number, last: number, event: Event) => boolean | void)
    | undefined;
  selectedIndex?: number | undefined;
  selectedTabClassName?: string | undefined;
  selectedTabPanelClassName?: string | undefined;
}

export interface TabListProps
  extends Omit<HTMLProps<HTMLUListElement>, 'className'> {
  className?: string | string[] | { [name: string]: boolean } | undefined;
}

export interface TabProps
  extends Omit<HTMLProps<HTMLLIElement>, 'className' | 'tabIndex'> {
  className?: string | string[] | { [name: string]: boolean } | undefined;
  disabled?: boolean | undefined;
  disabledClassName?: string | undefined;
  selectedClassName?: string | undefined;
  tabIndex?: string | undefined;
}

export interface TabPanelProps
  extends Omit<HTMLProps<HTMLDivElement>, 'className'> {
  className?: string | string[] | { [name: string]: boolean } | undefined;
  forceRender?: boolean | undefined;
  selectedClassName?: string | undefined;
}

export interface ReactTabsFunctionComponent<P = {}> extends FunctionComponent<P> {
  tabsRole: 'Tabs' | 'TabList' | 'Tab' | 'TabPanel';
}

export const Tabs: FunctionComponent<TabsProps>;
export const TabList: FunctionComponent<TabListProps>;
export const Tab: FunctionComponent<TabProps>;
export const TabPanel: FunctionComponent<TabPanelProps>;

const webpack = require('webpack');
const path = require('path');
const HtmlWebpackPlugin = require('html-webpack-plugin');
const MiniCssExtractPlugin = require('mini-css-extract-plugin');
const CssMinimizerPlugin = require('css-minimizer-webpack-plugin');

const sourceDirectory = path.resolve(__dirname, 'examples/src');
const targetDirectory = path.resolve(__dirname, 'examples/dist');

const isDev = process.env.NODE_ENV !== 'production';

const plugins = [
  new HtmlWebpackPlugin({
    inject: true,
    template: path.resolve(sourceDirectory, 'index.html'),
    minify: {
      collapseWhitespace: !isDev,
      removeComments: !isDev,
      removeRedundantAttributes: !isDev,
    },
  }),
  new MiniCssExtractPlugin({
    filename: '[name]-[contenthash].css',
    chunkFilename: '[name]-[contenthash].css',
  }),
];

if (!isDev) {
  plugins.push(
    new webpack.DefinePlugin({
      'process.env.NODE_ENV': JSON.stringify('production'),
    }),
  );
}

module.exports = {
  mode: isDev ? 'development' : 'production',
  context: sourceDirectory,
  entry: {
    app: './app.js',
  },
  optimization: {
    minimizer: [
      `...`,
      new CssMinimizerPlugin(),
    ],
  },
  target: 'web',
  output: {
    path: targetDirectory,
    chunkFilename: 'chunk-[chunkhash].js',
    filename: '[name]-[chunkhash].js',
    hashDigestLength: 8,
    publicPath: isDev ? '/' : './',
  },
  devServer: {
    static: {
      directory: targetDirectory,
    },
    allowedHosts: ['localhost', '.gitpod.io'],
    port: 8000,
  },
  module: {
    rules: [
      {
        test: /\.js$/,
        exclude: [/node_modules/],
        use: [
          {
            loader: 'babel-loader',
          },
        ],
      },
      {
        test: /\.(less|css)$/,
        use: [MiniCssExtractPlugin.loader, 'css-loader', 'less-loader'],
        sideEffects: true,
      },
      {
        test: /\.(png|svg)$/,
        type: 'asset/resource',
        sideEffects: true,
      },
      {
        test: /\.html$/,
        use: [
          {
            loader: 'html-loader',
          },
        ],
      },
    ],
  },
  resolve: {
    alias: {
      'react-tabs': path.resolve(__dirname, 'src/index'),
    },
  },
  plugins,
};
